	(165, 'Savings Accounts Dormancy Report', 'Table', NULL, 'Savings', 'select cl.display_name as \'Client Display Name\',\r\nsa.account_no as \'Account Number\',\r\ncl.mobile_no as \'Mobile Number\',\r\n@lastdate:=(select IFNULL(max(sat.transaction_date),sa.activatedon_date) \r\n            from m_savings_account_transaction as sat \r\n            where sat.is_reversed = 0 \r\n            and sat.transaction_type_enum in (1,2) \r\n            and sat.savings_account_id = sa.id) as \'Date of Last Activity\',\r\nDATEDIFF(now(), @lastdate) as \'Days Since Last Activity\'\r\nfrom m_savings_account as sa \r\ninner join m_savings_product as sp on (sa.product_id = sp.id and sp.is_dormancy_tracking_active = 1) \r\nleft join m_client as cl on sa.client_id = cl.id \r\nwhere sa.sub_status_enum = ${subStatus}\r\nand cl.office_id = ${officeId}', NULL, 1, 1, 0),
	(166, 'Progress Report', 'Pentaho', NULL, 'Accounting', NULL, 'ProgressReport', 0, 1, 0),
	(167, 'BranchOverView', 'Table', NULL, 'Client', 'select "Loan Officer" is_loan_officer  ,count(stf.office_id)\nfrom m_staff stf\nwhere stf.office_id in (\nselect of.id from m_office of where \n of.hierarchy like concat((select ino.hierarchy from m_office ino where ino.id = ${officeId}),"%" ) \n) and stf.is_loan_officer=1 and stf.is_active=1\n\nunion\n\nselect "Staff" office_id,count(office_id)\nfrom m_staff stf\nwhere stf.office_id in (\nselect of.id from m_office of where \n of.hierarchy like concat((select ino.hierarchy from m_office ino where ino.id = ${officeId}),"%" ) \n) and stf.is_active=1\n\nunion\n\nselect "Center",count(mg.id)\nfrom m_group mg\nwhere mg.level_id=1 and mg.office_id in (\nselect of.id from m_office of where \n of.hierarchy like concat((select ino.hierarchy from m_office ino where ino.id = ${officeId}),"%" ) \n)\n\nunion\n\nselect "Groups",count(mg1.id)\nfrom m_group mg1\nwhere mg1.level_id=2  and mg1.office_id in (\nselect of.id from m_office of where \n of.hierarchy like concat((select ino.hierarchy from m_office ino where ino.id = ${officeId}),"%" ) \n)\n\nunion\n\nselect "Clients", count(mc.id)\nfrom m_client mc\nwhere mc.status_enum=300 and mc.office_id in (\nselect of.id from m_office of where \n of.hierarchy like concat((select ino.hierarchy from m_office ino where ino.id = ${officeId}),"%" ) \n)\n\nunion\n\nselect"Borrowers",count(distinct(ml.client_id))\nfrom m_loan ml\nleft join m_client mc on ml.client_id=mc.id\nwhere ml.loan_status_id=300 and mc.office_id in (\nselect of.id from m_office of where \n of.hierarchy like concat((select ino.hierarchy from m_office ino where ino.id = ${officeId}),"%" ) \n)\n\nunion\n\nselect "Loan Accounts",count(ml.id)\nfrom m_loan ml\nleft join m_client mc on ml.client_id=mc.id\nwhere ml.loan_status_id=300 and mc.office_id in (\nselect of.id from m_office of where \n of.hierarchy like concat((select ino.hierarchy from m_office ino where ino.id = ${officeId}),"%" ) \n)\n\nunion\n\nselect"Saving Accounts",count(msa.id)\nfrom m_savings_account msa\nleft join m_client mc on msa.client_id=mc.id\nwhere msa.status_enum=300 and mc.office_id in (\nselect of.id from m_office of where \n of.hierarchy like concat((select ino.hierarchy from m_office ino where ino.id = ${officeId}),"%" ) \n)', 'Branch overview dashboard', 0, 1, 0),
	(168, 'LoanPortfolio', 'Table', NULL, 'Loan', 'select mpl.short_name Product\n,sum((ml.principal_disbursed_derived)) Disbursal\n,sum(ml.total_outstanding_derived) Outstanding\n,COALESCE (sum(agg.total_overdue_derived),0) Arrears\nfrom m_product_loan mpl\nleft join m_loan ml on mpl.id=ml.product_id\nleft join m_loan_arrears_aging agg on agg.loan_id=ml.id\nleft join m_client mc on ml.client_id=mc.id\nwhere mc.office_id in (\nselect of.id from m_office of where \n of.hierarchy like concat((select ino.hierarchy from m_office ino where ino.id = ${officeId}),"%" ) \n)\ngroup by ml.product_id\norder by ml.principal_disbursed_derived', 'Loan Portfolio dashboard', 0, 1, 0),
	(169, 'Branchwise Loan Summary', 'Pentaho', NULL, 'Loan', NULL, 'Branchwise Loan Summary', 0, 1, 0),
