	(176, 'enitityAuditLogs', 'Table', NULL, NULL, 'SELECT\nlog.id As id,\nlog.action_name As action,\nlog.command_as_json As changes,\nlog.made_on_date As updateDate,\nCONCAT(maker.firstname, maker.lastname) As updateBy,\nCONCAT(checker.firstname, checker.lastname) As approvedBy\nFROM\nm_portfolio_command_source log\nLEFT JOIN m_appuser maker ON maker.id = log.maker_id\nLEFT JOIN  m_appuser checker ON checker.id = log.checker_id\nWHERE log.resource_id = ${resourceId}\nAND log.entity_name = \'${enitityName}\'\nORDER BY log.made_on_date DESC', NULL, 0, 1, 0),
	(177, 'Disbursement Reminder Sms', 'report', NULL, 'sms', 'select c.id as id ,c.mobile_no as mobileNo, \nc.display_name as clientName, l.principal_amount as disbursementAmount\n,l.expected_disbursedon_date as disbursementDate\n from m_client c \nleft join m_loan l on l.client_id=c.id \nwhere l.expected_disbursedon_date = DATE_ADD(CURDATE(),INTERVAL 1 DAY)', NULL, 1, 1, 0),
	(178, 'Disbursement Success Sms', 'report', NULL, 'sms', 'select c.id as id ,c.mobile_no as mobileNo, \nc.display_name as clientName, mlt.amount as disbursementAmount\n,mlt.transaction_date as disbursementDate\n from m_client c \nleft join m_loan l on l.client_id=c.id \nleft join m_loan_transaction mlt on mlt.loan_id=l.id\nwhere mlt.transaction_type_enum=1 and (mlt.created_date > DATE_SUB(NOW(), INTERVAL 5 MINUTE))', NULL, 1, 1, 0),
	(179, 'Repayment Reminder Sms', 'report', NULL, 'sms', 'select c.id as id ,c.mobile_no as mobileNo, c.display_name as clientName, lrs.duedate as repaymentDate\nfrom m_client c \nleft join m_loan l on l.client_id=c.id \nleft join m_loan_repayment_schedule lrs on lrs.loan_id = l.id\nwhere lrs.duedate = DATE_ADD(CURDATE(),INTERVAL 1 DAY)', NULL, 1, 1, 0),
	(180, 'Repayment Success Sms', 'report', NULL, 'sms', 'select c.id as id \n,c.mobile_no as mobileNo\n, c.display_name as clientName\n,mlt.transaction_date as repaymentDate\n,mlt.amount AS repaymentAmount\nfrom m_client c \nleft join m_loan l on l.client_id=c.id \nleft join m_loan_transaction mlt on mlt.loan_id=l.id\nwhere mlt.transaction_type_enum=2 \nand \n(mlt.created_date > DATE_SUB(NOW(), INTERVAL 5 MINUTE))', NULL, 1, 1, 0),
	(181, 'LoanTransactionsForPaymentReconciliation', 'Table', NULL, 'Accounting', 'select tr.id AS LOAN_TRANSACTION_NO,\ntr.amount AS AMOUNT,\nl.id AS LOAN_ID, \nl.account_no AS LOAN_ACCOUNT_NO,\ng.external_id AS GROUP_EXTERNAL_ID,\noffice.name AS BRANCH,\ntr.transaction_date AS TRANSACTION_DATE,\npd.payment_type_id as PAYMENT_TYPE,\nIF(tr.transaction_type_enum = 1,"Disbursement","Client Payment") as TRANSACTION_TYPE\nFROM m_office office \nJOIN m_office ounder on ounder.hierarchy like concat(office.hierarchy,"%") \nand ounder.hierarchy like concat((select ino.hierarchy from m_office ino where ino.id = ${officeId}),"%" ) \nJOIN m_loan_transaction tr ON  tr.office_id = office.id and (tr.transaction_type_enum in (1,2,8) and tr.is_reversed = 0 \nand tr.is_reconciled = 0 and tr.id IS NOT NULL)\nLEFT JOIN m_payment_detail pd on(tr.payment_detail_id = pd.id)\nLEFT JOIN m_loan l ON (tr.loan_id = l.id)\nLEFT JOIN m_group g ON g.id=l.group_id\nwhere ${searchCriteria}\ngroup by tr.id order by tr.id desc', 'payment reconciliation with date', 0, 1, 0),
	(182, 'Clients Dropout Details', 'Pentaho', NULL, 'Client', NULL, NULL, 0, 1, 0),
	(183, 'Custom written-off report', 'Pentaho', NULL, 'Client', NULL, NULL, 0, 1, 0),
	(184, 'Custom written-off repayment', 'Pentaho', NULL, 'Client', NULL, NULL, 0, 1, 0),
	(185, 'Journal Voucher', 'Pentaho', NULL, 'Accounting', NULL, 'Journal Voucher', 1, 1, 0),
	(186, 'Journal Entry - Details', 'Pentaho', NULL, 'Accounting', NULL, 'Journal Entry - Details report', 1, 1, 0),
	(187, 'CLIENTGUARANTEE', 'Table', NULL, 'Client', '\nselect \nclient.id as "clientId",\nloan.id as "LoanId",\nloan.account_no as "LoanAccountNo",\nloan.loan_status_id as "LoanStatusId",\nreportenum.enum_key as "LoanStatusKey",\nproduct.`name` as "Product", \nloan.principal_amount as "LoanAmount"\nfrom \nm_guarantor guarantor, m_loan loan, m_product_loan product , r_enum_value reportenum, m_client client, m_office office\nwhere\nguarantor.entity_id = ${clientId} \nand guarantor.type_enum = 1\nand guarantor.is_active = 1\nand guarantor.entity_id = client.id\nand client.office_id = office.id\nand guarantor.loan_id = loan.id\nand loan.product_id = product.id\nand loan.loan_status_id = reportenum.enum_id\nand reportenum.enum_name = "loan_status_id"\nand office.hierarchy like concat("${currentUserHierarchy}", "%")\norder by loan.id desc\n    ', 'Report lists all loans guaranteed by a client', 0, 0, 0),
	(188, 'Repayment Schedule', 'Pentaho', NULL, 'Loan', NULL, 'Repayment Schedule', 1, 1, 0),
	(189, 'Arrears Summary isloanofficer', 'Table', NULL, 'Loan', 'select v.arrPeriod ArrearsBy ,v.totalDisbAmt,v.OutstandingAmt,v.arrearsAmt, b.tot `count` from (select a.arrPeriod arrPeriod,sum(a.totalDisbAmt) totalDisbAmt,sum(a.OutstandingAmt) OutstandingAmt, sum(a.arrearsAmt)  arrearsAmt\nfrom (SELECT ml.id loanId, \nsum(IFNULL(ml.principal_disbursed_derived,0)) as TotalDisbAmt,\nsum(ml.total_outstanding_derived) as OutstandingAmt,\nsum(laa.total_overdue_derived) ArrearsAmt,\nIFNULL(laa.overdue_since_date_derived, curdate()) as minOverdueDate,\nIF(DATEDIFF(CURDATE(), laa.overdue_since_date_derived) BETWEEN 1 AND 30, \'1 - 30\',  \nIF(DATEDIFF(CURDATE(), laa.overdue_since_date_derived) BETWEEN 31 AND 60, \'31 - 60\', \nIF(DATEDIFF(CURDATE(), laa.overdue_since_date_derived) BETWEEN 61 AND 90, \'61 - 90\', \'91+\'))) AS arrPeriod\nFROM m_appuser a\n\ninner join  m_office o on o.id = a.office_id\nINNER JOIN m_office ounder ON ounder.hierarchy \nLIKE CONCAT(o.hierarchy, \'%\')\nAND ounder.hierarchy like CONCAT(\'.\', \'%\')\ninner join m_staff s on s.id = a.staff_id\ninner join m_loan ml on ml.loan_officer_id = s.id\ninner join m_loan_arrears_aging laa ON laa.loan_id = ml.id\nWHERE ml.loan_status_id=300\nand a.id = ${currentUserId}\ngroup by 6)a\ngroup by 1)v\nleft join \n(select sum(a.total) tot,a.arrPeriod from ((select count(*) total,IF(DATEDIFF(CURDATE(), aa.overdue_since_date_derived) BETWEEN 1 AND 30, \'1 - 30\',  \nIF(DATEDIFF(CURDATE(), aa.overdue_since_date_derived) BETWEEN 31 AND 60, \'31 - 60\', \nIF(DATEDIFF(CURDATE(), aa.overdue_since_date_derived) BETWEEN 61 AND 90, \'61 - 90\', \'91+\'))) AS arrPeriod\nFROM m_appuser a\n\ninner join  m_office o on o.id = a.office_id\nINNER JOIN m_office ounder ON ounder.hierarchy \nLIKE CONCAT(o.hierarchy, \'%\')\nAND ounder.hierarchy like CONCAT(\'.\', \'%\')\ninner join m_staff s on s.id = a.staff_id\ninner join m_loan ml on ml.loan_officer_id = s.id and ml.loan_type_enum = 4\ninner join m_loan_arrears_aging aa on aa.loan_id = ml.id\ninner join m_loan_glim lg on lg.loan_id = ml.id\nwhere a.id = ${currentUserId}\n\ngroup by 2)\nunion\n(select count(*),IF(DATEDIFF(CURDATE(), aa.overdue_since_date_derived) BETWEEN 1 AND 30, \'1 - 30\',  \nIF(DATEDIFF(CURDATE(), aa.overdue_since_date_derived) BETWEEN 31 AND 60, \'31 - 60\', \nIF(DATEDIFF(CURDATE(), aa.overdue_since_date_derived) BETWEEN 61 AND 90, \'61 - 90\', \'91+\'))) AS arrPeriod\nFROM m_appuser a\n\ninner join  m_office o on o.id = a.office_id\nINNER JOIN m_office ounder ON ounder.hierarchy \nLIKE CONCAT(o.hierarchy, \'%\')\nAND ounder.hierarchy like CONCAT(\'.\', \'%\')\ninner join m_staff s on s.id = a.staff_id\ninner join m_loan ml on ml.loan_officer_id = s.id and ml.loan_type_enum in (1,2,3)\ninner join m_loan_arrears_aging aa on aa.loan_id = ml.id\nwhere a.id = ${currentUserId}\ngroup by 2)\n)a\ngroup by 2)b on b.arrPeriod =v.arrPeriod\norder by v.arrearsAmt desc\n', NULL, 0, 1, 0),
	(190, 'Arrears Summary notaloanofficer', 'Table', NULL, 'Loan', '	  select v.arrPeriod band,v.totalDisbAmt,v.OutstandingAmt,v.arrearsAmt, b.tot `count` from (select a.arrPeriod arrPeriod,sum(a.totalDisbAmt) totalDisbAmt,sum(a.OutstandingAmt) OutstandingAmt, sum(a.arrearsAmt)  arrearsAmt\nfrom (SELECT ml.id loanId, \nsum(IFNULL(ml.principal_disbursed_derived,0)) as totalDisbAmt,\nsum(ml.total_outstanding_derived) as OutstandingAmt,\nsum(laa.total_overdue_derived) arrearsAmt,\nIFNULL(laa.overdue_since_date_derived, curdate()) as minOverdueDate,\nIF(DATEDIFF(CURDATE(), laa.overdue_since_date_derived) BETWEEN 1 AND 30, \'1 - 30\',  \nIF(DATEDIFF(CURDATE(), laa.overdue_since_date_derived) BETWEEN 31 AND 60, \'31 - 60\', \nIF(DATEDIFF(CURDATE(), laa.overdue_since_date_derived) BETWEEN 61 AND 90, \'61 - 90\', \'91+\'))) AS arrPeriod\nFROM m_appuser a\n\ninner join  m_office o on o.id = a.office_id\nINNER JOIN m_office ounder ON ounder.hierarchy \nLIKE CONCAT(o.hierarchy, \'%\')\nAND ounder.hierarchy like CONCAT(\'.\', \'%\')\ninner join m_client c on c.office_id = ounder.id\ninner join m_loan ml on ml.client_id = c.id\ninner join m_loan_arrears_aging laa ON laa.loan_id = ml.id\n\n\nWHERE ml.loan_status_id=300\nAND a.id = ${currentUserId}\ngroup by 6\nunion\nSELECT ml.id loanId, \nsum(IFNULL(ml.principal_disbursed_derived,0)) as totalDisbAmt,\nsum(ml.total_outstanding_derived) as OutstandingAmt,\nsum(laa.total_overdue_derived) arrearsAmt,\nIFNULL(laa.overdue_since_date_derived, curdate()) as minOverdueDate,\nIF(DATEDIFF(CURDATE(), laa.overdue_since_date_derived) BETWEEN 1 AND 30, \'1 - 30\',  \nIF(DATEDIFF(CURDATE(), laa.overdue_since_date_derived) BETWEEN 31 AND 60, \'31 - 60\', \nIF(DATEDIFF(CURDATE(), laa.overdue_since_date_derived) BETWEEN 61 AND 90, \'61 - 90\', \'91+\'))) AS arrPeriod\nFROM m_appuser a\n\ninner join  m_office o on o.id = a.office_id\nINNER JOIN m_office ounder ON ounder.hierarchy \nLIKE CONCAT(o.hierarchy, \'%\')\nAND ounder.hierarchy like CONCAT(\'.\', \'%\')\ninner join m_group c on c.office_id = ounder.id\ninner join m_loan ml on ml.group_id = c.id\ninner join m_loan_arrears_aging laa ON laa.loan_id = ml.id\n#left join m_loan_glim lg on lg.loan_id = ml.id\nWHERE ml.loan_status_id=300\nAND a.id = ${currentUserId}\ngroup by 6)a\ngroup by 1)v\nleft join \n(select sum(a.total) tot,a.arrPeriod from ((select count(*) total,IF(DATEDIFF(CURDATE(), aa.overdue_since_date_derived) BETWEEN 1 AND 30, \'1 - 30\',  \nIF(DATEDIFF(CURDATE(), aa.overdue_since_date_derived) BETWEEN 31 AND 60, \'31 - 60\', \nIF(DATEDIFF(CURDATE(), aa.overdue_since_date_derived) BETWEEN 61 AND 90, \'61 - 90\', \'91+\'))) AS arrPeriod\nFROM m_appuser a\n\ninner join  m_office o on o.id = a.office_id\nINNER JOIN m_office ounder ON ounder.hierarchy \nLIKE CONCAT(o.hierarchy, \'%\')\nAND ounder.hierarchy like CONCAT(\'.\', \'%\')\ninner join m_group c on c.office_id = ounder.id\ninner join m_loan m on m.group_id = c.id\ninner join m_loan_arrears_aging aa on aa.loan_id = m.id\ninner join m_loan_glim lg on lg.loan_id = m.id\nwhere a.id = ${currentUserId}\ngroup by 2)\nunion\n(select count(*),IF(DATEDIFF(CURDATE(), aa.overdue_since_date_derived) BETWEEN 1 AND 30, \'1 - 30\',  \nIF(DATEDIFF(CURDATE(), aa.overdue_since_date_derived) BETWEEN 31 AND 60, \'31 - 60\', \nIF(DATEDIFF(CURDATE(), aa.overdue_since_date_derived) BETWEEN 61 AND 90, \'61 - 90\', \'91+\'))) AS arrPeriod\nFROM m_appuser a\n\ninner join  m_office o on o.id = a.office_id\nINNER JOIN m_office ounder ON ounder.hierarchy \nLIKE CONCAT(o.hierarchy, \'%\')\nAND ounder.hierarchy like CONCAT(\'.\', \'%\')\ninner join m_group c on c.office_id = ounder.id\ninner join m_loan m on m.group_id = c.id\ninner join m_loan_arrears_aging aa on aa.loan_id = m.id and m.loan_type_enum = 2\nwhere a.id = ${currentUserId}\ngroup by 2)\nunion\n(select count(*),IF(DATEDIFF(CURDATE(), aa.overdue_since_date_derived) BETWEEN 1 AND 30, \'1 - 30\',  \nIF(DATEDIFF(CURDATE(), aa.overdue_since_date_derived) BETWEEN 31 AND 60, \'31 - 60\', \nIF(DATEDIFF(CURDATE(), aa.overdue_since_date_derived) BETWEEN 61 AND 90, \'61 - 90\', \'91+\'))) AS arrPeriod\nFROM m_appuser a\n\ninner join  m_office o on o.id = a.office_id\nINNER JOIN m_office ounder ON ounder.hierarchy \nLIKE CONCAT(o.hierarchy, \'%\')\nAND ounder.hierarchy like CONCAT(\'.\', \'%\')\ninner join m_client c on c.office_id = ounder.id\ninner join m_loan m on m.client_id = c.id\ninner join m_loan_arrears_aging aa on aa.loan_id = m.id and m.loan_type_enum in (1,3)\nwhere a.id = ${currentUserId}\ngroup by 2))a\ngroup by 2)b on b.arrPeriod =v.arrPeriod\norder by v.arrearsAmt desc\n', NULL, 0, 1, 0),
	(191, 'Arrears bucket isloanofficer', 'Table', NULL, 'Loan', 'select a.loanId\n,a.TotalDisbAmt\n,a.OutstandingAmt\n,a.ArrearsAmt\n,a.days\n,a.loantype\nfrom  (SELECT ml.id loanId, if((ml.loan_type_enum = 4),\'glim\', \'non-glim\') loantype,\nIFNULL(ml.principal_disbursed_derived,0) as TotalDisbAmt,\nml.total_outstanding_derived as OutstandingAmt,\nlaa.total_overdue_derived ArrearsAmt,\nIFNULL(laa.overdue_since_date_derived, curdate()) as minOverdueDate,\nIF(DATEDIFF(CURDATE(), laa.overdue_since_date_derived) BETWEEN 1 AND 30, \'1 - 30\',  \nIF(DATEDIFF(CURDATE(), laa.overdue_since_date_derived) BETWEEN 31 AND 60, \'31 - 60\', \nIF(DATEDIFF(CURDATE(), laa.overdue_since_date_derived) BETWEEN 61 AND 90, \'61 - 90\', \'91+\'))) AS arrPeriod\n,DATEDIFF(CURDATE(), laa.overdue_since_date_derived) days\nFROM m_appuser a\n\ninner join  m_office o on o.id = a.office_id\nINNER JOIN m_office ounder ON ounder.hierarchy \nLIKE CONCAT(o.hierarchy, \'%\')\nAND ounder.hierarchy like CONCAT(\'.\', \'%\')\ninner join m_staff s on s.id = a.staff_id\ninner join m_loan ml on ml.loan_officer_id = s.id\ninner join m_loan_arrears_aging laa ON laa.loan_id = ml.id\nleft join m_loan_glim lg on lg.loan_id = ml.id\nWHERE ml.loan_status_id=300\nand a.id = ${currentUserId}\nhaving \ncase when  \'${accountNo}\' = \'1-30\' then arrPeriod = \'1 - 30\'\n     when  \'${accountNo}\' = \'31-60\' then arrPeriod = \'31 - 60\'\n	  when  \'${accountNo}\' = \'61-90\' then arrPeriod = \'61 - 90\' \n	  when  \'${accountNo}\' = \'91\' then arrPeriod = \'91+\' end)a\n	  order by a.ArrearsAmt desc\n', NULL, 0, 1, 0),
	(192, 'Arrears bucket notaloanofficer', 'Table', NULL, 'Loan', 'select a.loanId\n,a.TotalDisbAmt\n,a.OutstandingAmt\n,a.ArrearsAmt\n,a.days\n,a.loantype\nfrom (SELECT ml.id loanId, if((ml.loan_type_enum = 4),\'glim\', \'non-glim\') loantype,\nIFNULL(lg.disbursed_amount,ml.principal_disbursed_derived) as totalDisbAmt,\nifnull((lg.total_payble_amount-lg.paid_amount),ml.total_outstanding_derived) as OutstandingAmt,\nlaa.total_overdue_derived arrearsAmt,\nIFNULL(laa.overdue_since_date_derived, curdate()) as minOverdueDate,\nIF(DATEDIFF(CURDATE(), laa.overdue_since_date_derived) BETWEEN 1 AND 30, \'1 - 30\',  \nIF(DATEDIFF(CURDATE(), laa.overdue_since_date_derived) BETWEEN 31 AND 60, \'31 - 60\', \nIF(DATEDIFF(CURDATE(), laa.overdue_since_date_derived) BETWEEN 61 AND 90, \'61 - 90\', \'91+\'))) AS arrPeriod,\nDATEDIFF(CURDATE(), laa.overdue_since_date_derived) days\nFROM m_appuser a\n\ninner join  m_office o on o.id = a.office_id\nINNER JOIN m_office ounder ON ounder.hierarchy \nLIKE CONCAT(o.hierarchy, \'%\')\nAND ounder.hierarchy like CONCAT(\'.\', \'%\')\ninner join m_group c on c.office_id = ounder.id\ninner join m_loan ml on ml.group_id = c.id\ninner join m_loan_arrears_aging laa ON laa.loan_id = ml.id\nleft join m_loan_glim lg on lg.loan_id = ml.id\nWHERE ml.loan_status_id=300\nAND a.id = ${currentUserId}\nhaving \ncase when \'${accountNo}\' = \'1-30\' then arrPeriod = \'1 - 30\'\n     when \'${accountNo}\' = \'31-60\' then arrPeriod = \'31 - 60\'\n	  when \'${accountNo}\' = \'61-90\' then arrPeriod = \'61 - 90\' \n	  when \'${accountNo}\' = \'91\' then arrPeriod = \'91+\' end\nunion\nSELECT ml.id loanId, if((ml.loan_type_enum = 4),\'glim\', \'non-glim\') loantype,\nIFNULL(ml.principal_disbursed_derived,0) as totalDisbAmt,\nml.total_outstanding_derived as OutstandingAmt,\nlaa.total_overdue_derived arrearsAmt,\nIFNULL(laa.overdue_since_date_derived, curdate()) as minOverdueDate,\nIF(DATEDIFF(CURDATE(), laa.overdue_since_date_derived) BETWEEN 1 AND 30, \'1 - 30\',  \nIF(DATEDIFF(CURDATE(), laa.overdue_since_date_derived) BETWEEN 31 AND 60, \'31 - 60\', \nIF(DATEDIFF(CURDATE(), laa.overdue_since_date_derived) BETWEEN 61 AND 90, \'61 - 90\', \'91+\'))) AS arrPeriod\n,DATEDIFF(CURDATE(), laa.overdue_since_date_derived) days\nFROM m_appuser a\n\ninner join  m_office o on o.id = a.office_id\nINNER JOIN m_office ounder ON ounder.hierarchy \nLIKE CONCAT(o.hierarchy, \'%\')\nAND ounder.hierarchy like CONCAT(\'.\', \'%\')\ninner join m_client c on c.office_id = ounder.id\ninner join m_loan ml on ml.client_id = c.id and ml.loan_type_enum = 1\ninner join m_loan_arrears_aging laa ON laa.loan_id = ml.id\nWHERE ml.loan_status_id=300\nAND a.id = ${currentUserId}\nhaving \ncase when \'${accountNo}\' = \'1-30\' then arrPeriod = \'1 - 30\'\n     when \'${accountNo}\' = \'31-60\' then arrPeriod = \'31 - 60\'\n	  when \'${accountNo}\' = \'61-90\' then arrPeriod = \'61 - 90\' \n	  when \'${accountNo}\' = \'91\' then arrPeriod = \'91+\' end)a\norder by a.ArrearsAmt desc,loanId\n', NULL, 0, 1, 0),
	(193, 'Matured loan report notaloanofficer', 'Table', NULL, 'Loan', 'select a.loan_product_id,\na.loan_product_name,\nsum(a.loan_count) as loan_count,\nsum(a.outstanding_amount) as outstanding_amount\n\n from (SELECT \nmpl.id as \'loan_product_id\',\nmpl.name as \'loan_product_name\',\nCOUNT(ml.id) as \'loan_count\',\nSUM(ml.total_outstanding_derived) as \'outstanding_amount\' \n\nFROM m_appuser a\n\ninner join  m_office o on o.id = a.office_id\nINNER JOIN m_office ounder ON ounder.hierarchy \nLIKE CONCAT(o.hierarchy, \'%\')\nAND ounder.hierarchy like CONCAT(\'.\', \'%\')\ninner join m_client c on c.office_id = ounder.id\ninner join m_loan ml on ml.client_id = c.id and ml.loan_type_enum = 1\nJOIN  m_product_loan mpl on ml.product_id = mpl.id\nwhere a.id = ${currentUserId}\nand (MONTH(ml.expected_maturedon_date) = MONTH(\'${startDate}\')  \nand year(ml.expected_maturedon_date) = year(\'${startDate}\'))\n\nGROUP BY mpl.id\nunion\nSELECT \nmpl.id as \'loan_product_id\',\nmpl.name as \'loan_product_name\',\nCOUNT(ml.id) as \'loan_count\',\nsum(ifnull((lg.total_payble_amount-lg.paid_amount),ml.total_outstanding_derived)) as \'outstanding_amount\'\nFROM m_appuser a\n\ninner join  m_office o on o.id = a.office_id\nINNER JOIN m_office ounder ON ounder.hierarchy \nLIKE CONCAT(o.hierarchy, \'%\')\nAND ounder.hierarchy like CONCAT(\'.\', \'%\')\ninner join m_group c on c.office_id = ounder.id\ninner join m_loan ml on ml.group_id = c.id\nJOIN  m_product_loan mpl on ml.product_id = mpl.id\nleft join m_loan_glim lg on lg.loan_id = ml.id\nwhere a.id = ${currentUserId}\nand (MONTH(ml.expected_maturedon_date) = MONTH(\'${startDate}\')\nand year(ml.expected_maturedon_date) = year(\'${startDate}\'))\nGROUP BY mpl.id)a\ngroup by 1\norder by outstanding_amount desc\n', NULL, 0, 1, 0),
	(194, 'Matured loan product level notaloanofficer', 'Table', NULL, 'Loan', 'SELECT \nml.id as \'loan_id\',\nifnull(ml.principal_disbursed_derived,0) \'disbursed_amount\',\nifnull(ml.total_outstanding_derived,0) as \'outstanding_amount\',\nml.expected_maturedon_date\nFROM m_appuser a\n\ninner join  m_office o on o.id = a.office_id\nINNER JOIN m_office ounder ON ounder.hierarchy \nLIKE CONCAT(o.hierarchy, \'%\')\nAND ounder.hierarchy like CONCAT(\'.\', \'%\')\ninner join m_client c on c.office_id = ounder.id\ninner join m_loan ml on ml.client_id = c.id and ml.loan_type_enum = 1\nJOIN  m_product_loan mpl on ml.product_id = mpl.id\n#WHERE ml.loan_status_id=300\nwhere a.id = ${currentUserId}\nand mpl.id = \'${loanProductIdonly}\'\nand (MONTH(ml.expected_maturedon_date) = MONTH(\'${startDate}\')\nand year(ml.expected_maturedon_date) = year(\'${startDate}\'))\nunion\nSELECT \nml.id as \'loan_id\',\nifnull(lg.disbursed_amount,ml.principal_disbursed_derived) \'disbursed_amount\',\nifnull((lg.total_payble_amount-lg.paid_amount),ml.total_outstanding_derived) as \'outstanding_amount\',\nml.expected_maturedon_date\nFROM m_appuser a\n\ninner join  m_office o on o.id = a.office_id\nINNER JOIN m_office ounder ON ounder.hierarchy \nLIKE CONCAT(o.hierarchy, \'%\')\nAND ounder.hierarchy like CONCAT(\'.\', \'%\')\ninner join m_group c on c.office_id = ounder.id\ninner join m_loan ml on ml.group_id = c.id\nJOIN  m_product_loan mpl on ml.product_id = mpl.id\nleft join m_loan_glim lg on lg.loan_id = ml.id\nwhere a.id = ${currentUserId}\nand mpl.id = \'${loanProductIdonly}\'\nand (MONTH(ml.expected_maturedon_date) = MONTH(\'${startDate}\')\nand year(ml.expected_maturedon_date) = year(\'${startDate}\'))\norder by outstanding_amount desc\n', NULL, 0, 1, 0),
	(195, 'Matured loan product level isloanofficer', 'Table', NULL, 'Loan', 'SELECT \nml.id as \'loan_id\',\nifnull(ml.principal_disbursed_derived,0) \'disbursed_amount\',\nifnull(ml.total_outstanding_derived,0) as \'outstanding_amount\',\nml.expected_maturedon_date\nFROM m_appuser a\n\ninner join  m_office o on o.id = a.office_id\nINNER JOIN m_office ounder ON ounder.hierarchy \nLIKE CONCAT(o.hierarchy, \'%\')\nAND ounder.hierarchy like CONCAT(\'.\', \'%\')\ninner join m_staff s on s.id = a.staff_id\ninner join m_loan ml on ml.loan_officer_id = s.id\nJOIN  m_product_loan mpl on ml.product_id = mpl.id\nwhere a.id = ${currentUserId}\nand mpl.id = \'${loanProductIdonly}\'\nand (MONTH(ml.expected_maturedon_date) = MONTH(\'${startDate}\')\nand year(ml.expected_maturedon_date) = year(\'${startDate}\'))\nunion\nSELECT \nml.id as \'loan_id\',\nifnull(ml.principal_disbursed_derived,0) \'disbursed_amount\',\nifnull(ml.total_outstanding_derived,0) as \'outstanding_amount\',\nml.expected_maturedon_date\nFROM m_appuser a\n\ninner join  m_office o on o.id = a.office_id\nINNER JOIN m_office ounder ON ounder.hierarchy \nLIKE CONCAT(o.hierarchy, \'%\')\nAND ounder.hierarchy like CONCAT(\'.\', \'%\')\ninner join m_staff s on s.id = a.staff_id\ninner join m_loan ml on ml.loan_officer_id = s.id\nleft join m_loan_glim lg on lg.loan_id = ml.id\nJOIN  m_product_loan mpl on ml.product_id = mpl.id\nwhere a.id = ${currentUserId}\nand mpl.id = \'${loanProductIdonly}\'\nand (MONTH(ml.expected_maturedon_date) = MONTH(\'${startDate}\')\nand year(ml.expected_maturedon_date) = year(\'${startDate}\'))\norder by outstanding_amount desc\n', NULL, 0, 1, 0),
	(196, 'Matured loan report isloanofficer', 'Table', NULL, 'Loan', '\nselect a.loan_product_id,\na.loan_product_name,\nsum(a.loan_count) as loan_count,\nsum(a.outstanding_amount) as outstanding_amount\n\n from (SELECT \nmpl.id as \'loan_product_id\',\nmpl.name as \'loan_product_name\',\nCOUNT(ml.id) as \'loan_count\',\nSUM(ml.total_outstanding_derived) as \'outstanding_amount\' \n\nFROM m_appuser a\n\ninner join  m_office o on o.id = a.office_id\nINNER JOIN m_office ounder ON ounder.hierarchy \nLIKE CONCAT(o.hierarchy, \'%\')\nAND ounder.hierarchy like CONCAT(\'.\', \'%\')\ninner join m_staff s on s.id = a.staff_id\ninner join m_client c on c.staff_id = s.id\ninner join m_loan ml on ml.client_id = c.id and ml.loan_type_enum = 1\nJOIN  m_product_loan mpl on ml.product_id = mpl.id\nwhere a.id = ${currentUserId}\nand (MONTH(ml.expected_maturedon_date) = MONTH(\'${startDate}\')\nand year(ml.expected_maturedon_date) = year(\'${startDate}\'))\n\nGROUP BY mpl.id\nunion\nSELECT \nmpl.id as \'loan_product_id\',\nmpl.name as \'loan_product_name\',\nCOUNT(ml.id) as \'loan_count\',\nsum(ifnull((lg.total_payble_amount-lg.paid_amount),ml.total_outstanding_derived)) as \'outstanding_amount\'\nFROM m_appuser a\n\ninner join  m_office o on o.id = a.office_id\nINNER JOIN m_office ounder ON ounder.hierarchy \nLIKE CONCAT(o.hierarchy, \'%\')\nAND ounder.hierarchy like CONCAT(\'.\', \'%\')\ninner join m_staff s on s.id = a.staff_id\ninner join m_group c on c.staff_id = s.id\ninner join m_loan ml on ml.group_id = c.id\nJOIN  m_product_loan mpl on ml.product_id = mpl.id\nleft join m_loan_glim lg on lg.loan_id = ml.id\nwhere a.id = ${currentUserId}\nand (MONTH(ml.expected_maturedon_date) = MONTH(\'${startDate}\')\nand year(ml.expected_maturedon_date) = year(\'${startDate}\'))\nGROUP BY mpl.id)a\ngroup by 1\norder by outstanding_amount desc\n', NULL, 0, 1, 0),
